なた豆歯磨き　ナタ豆歯磨き　なたまめ歯磨き粉<br><table width="600" border="0" cellspacing="0" cellpadding="0"><tbody><tr><td colspan="2"><table width="600" border="0" cellspacing="0" cellpadding="5"><tbody><tr><td bgcolor="#999999">　<font color="#ffffff" size="5"><strong>薩摩なた豆歯磨き　55g<br></strong></font><font color="#ffffff">話題の「なた豆」エキス入りのはみがき粉　なた豆歯磨き　なた豆ハミガキ</font></td></tr></tbody></table><br></td></tr><tr><td colspan="2" align="center"><img src="http://image.rakuten.co.jp/matsucame/cabinet/wat-04/wat1356-01.jpg" border="0" alt="なた豆歯磨き　ナタ豆歯磨き　なたまめ歯磨き粉" width="600" height="132"><br><br></td></tr><tr><td colspan="2"><font size="2"><strong>話題の「なた豆」入りハミガキ粉！鹿児島産「薩摩なた豆」抽出エキス入り歯磨き</strong><br><br>鹿児島の太陽のエネルギーと、シラス台地の栄養をたっぷり吸収して、天に向かってぐんぐん伸びるなた豆のパワーを凝縮した、大人気の歯磨きです。<br>他にもヒドロキシアパタイト、薩摩茶抽出エキス、キシリトール、甘草エキス、天日塩、ニガリなどの注目の成分をたっぷり配合しました。<br>磨いた後のスッキリ感にリピーター続出です！<br><br>～塩味の秘密～<br>初めてお使いになるお客様によく「塩味がする」というお声を頂きます。<br>"薩摩なた豆歯磨き"には、歴史のある、高品質で有名な赤穂の天日塩が入っています。<br>防腐剤の代用に、歯ぐきの引き締めに、塩には重要な役割があり、この歯磨きには欠かせない存在なのです。<br>使いはじめは、しょっぱく感じるかもしれませんが、磨いた後の"スッキリ"感には自信があります。<br>なた豆はみがき粉　なた豆ハミガキ　薩摩なた豆歯磨き </font><br><br></td></tr><tr><td width="200"><img src="http://image.rakuten.co.jp/matsucame/cabinet/wat-04/wat1356-00.jpg" width="200" border="0" alt="なた豆歯磨き　ナタ豆歯磨き　なたまめ歯磨き粉" height="200"></td><td width="396"><table style="FONT-SIZE: 10pt" width="396" border="1" cellspacing="0" cellpadding="5"><tbody><tr><td width="93" align="center">商品名</td><td width="277">薩摩なた豆歯磨き</td></tr><tr><td align="center">内容量</td><td>55g</td></tr><tr><td align="center">成分</td><td>炭酸Ca（研磨剤）、水（基剤）、海塩（その他）、グリセリン（湿潤剤）、ソルビトール（湿潤剤）、ヒドロキシアパタイト（研磨剤）、キシリトール（甘味剤）、ラウロイルグルタミン酸Na（発泡剤）、タマリンドガム（粘結剤）、ナタマメ種子エキス（着香剤）、香料（なた豆の茎・葉・莢抽出液含有）、チャエキス（保湿剤）、グリチルリチン酸2K（その他）、ハッカ油（着香剤）、銅クロロフィリンNa（その他）、エタノール（その他）、ニガリ（その他）</td></tr><tr><td align="center">保存方法</td><td>高温・多湿及び直射日光を避け、涼しい所に保管して下さい。開封後はなるべく早くご使用下さい。</td></tr><tr><td align="center">使用上の注意</td><td>本品の使用により、発疹、発赤、かゆみ、痛みなどの症状があらわれた場合は、使用を中止し、医師、歯科医師にご相談下さい。飲み込まないようにして下さい。使用後は必ずフタをし、清潔に保管して下さい。乳幼児の手に届かないところに保管して下さい。</td></tr><tr><td align="center">区分</td><td>はみがき粉</td></tr><tr><td align="center">広告文責</td><td>株式会社マツムラカメラ　076-242-1122</td></tr></tbody></table></td></tr></tbody></table><br>　なた豆歯磨き粉　ナタ豆歯磨き粉　なたまめ歯磨き粉　<br>送料区分：小<br><br><a href="http://my.bookmark.rakuten.co.jp/?func=reg&amp;svid=101&amp;shop_bid=211965&amp;iid=10025495&amp;itype=1" target="_blank"><img src="http://image.rakuten.co.jp/nihonnett/cabinet/001/okiniiri-e.jpg" width="700" height="60" border="0"></a><br><br><!--gift--><br><br><img src="http://image.rakuten.co.jp/matsucame/cabinet/00433839/gift.jpg"/><!--gift_end--><div style="color:#666; font-size:10px; width:500px;">母の日 ギフト 父の日 ギフト 敬老の日 ギフト クリスマス ギフト お正月 子供の日 ギフト バレンタインデー ギフト ホワイトデー ギフト 可愛い おしゃれ オシャレ パーティー 入学祝い ギフト 卒業祝い ギフト 結婚記念日 ギフト お歳暮 ギフト お中元 旧正月 春節 お誕生日 などのプレゼントに<br><br><u>大変申し訳ございませんが のし 包装は対応いたしておりません。</u></div><!--<table align="center" style="font-size:12px;" width="630" border="0" cellspacing="0" cellpadding="5">  <tr>    <td colspan="3" bgcolor="#FF6633" align="center"><img src="http://image.rakuten.co.jp/esteyou/cabinet/bnr/uresuji-bana.gif" width="600" border="0" /></td>  </tr><tr align="center">    <td width="200"><img src="http://image.rakuten.co.jp/esteyou/cabinet/tsu-04/tsu5259.jpg" width="200" border="0" /><br />
